import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { PlotListComponent } from './plot-list/plot-list.component';
import { PlotEditComponent } from './plot-edit/plot-edit.component';
import { PlotAddComponent } from './plot-add/plot-add.component';

const routes: Routes = [
  { path: '', redirectTo: '/plots', pathMatch: 'full' },
  { path: 'plots', component: PlotListComponent },
  { path: 'plots/add', component: PlotAddComponent },
  { path: 'plots/:id', component: PlotListComponent },
  { path: 'plots/:id/edit', component: PlotEditComponent },
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})

export class AppRoutingModule { }
